import React, {useState} from "react";
import MenuBar from "../components/MenuBar";

function App() {
    const [data, setData] = useState({});
    fetch('/api/testapi')
    .then(res => res.json(), () => {
        console.log('data read2: ', data);
    })
    .then(data => setData(data), () => {
        console.log('data read2: ', data);
    })

    return (
        <div className="App">
            <MenuBar></MenuBar>

        </div>
    );
}

export default App;
